import React from "react";
import "./NavBar.css";
import { useIsAuthenticated, useAuthUser } from "react-auth-kit";

const NavigationBar = () => {
  const authUser = useAuthUser();
  const isAuthenticated = useIsAuthenticated();
  return (
    <div className="navbar">
      <ul className="side left-side">
        <li>
          <a
            id="news"
            to="/"
            className={({ isActive }) => (isActive ? "active" : undefined)}
            end
          >
            News
          </a>
        </li>
        {!isAuthenticated() && (
          <li>
            <a
              to="/login"
              className={({ isActive }) => (isActive ? "active" : undefined)}
            >
              School
            </a>
          </li>
        )}
        {!isAuthenticated() && (
          <li>
            <a
              to="register"
              className={({ isActive }) => (isActive ? "active" : undefined)}
            >
              Work
            </a>
          </li>
        )}
        {!isAuthenticated() && (
          <li>
            <a
              to="contact"
              className={({ isActive }) => (isActive ? "active" : undefined)}
            >
              Home
            </a>
          </li>
        )}

        {!isAuthenticated() && (
          <li>
            <a
              to="about"
              className={({ isActive }) => (isActive ? "active" : undefined)}
            >
              Study
            </a>
          </li>
        )}

        {isAuthenticated() && (
          <li>
            <a
              to="presentation"
              className={({ isActive }) => (isActive ? "active" : undefined)}
            >
              Academy
            </a>
          </li>
        )}

        {isAuthenticated() && (
          <li>
            <a
              to="activePresentations"
              className={({ isActive }) => (isActive ? "active" : undefined)}
            >
              MarketPlace
            </a>
          </li>
        )}
      </ul>

      <ul className="side right-side">
        {isAuthenticated() && (
          <li>
            <a
              id="contact-sales"
              to="joinALecture"
              className={({ isActive }) => (isActive ? "active" : undefined)}
            >
              Contact Sales
            </a>
          </li>
        )}

        {isAuthenticated() && (
          <li>
            <a
              to="signOut"
              className={({ isActive }) => (isActive ? "active" : undefined)}
            >
              Explore Content
            </a>
          </li>
        )}

        <li>
          <a
            to="signOut"
            className={({ isActive }) => (isActive ? "active" : undefined)}
          >
            Play
          </a>
        </li>

        <li>
          <a
            id="sign-up"
            to="signOut"
            className={({ isActive }) => (isActive ? "active" : undefined)}
          >
            Sign Up
          </a>
        </li>

        <li>
          <a
            to="signOut"
            className={({ isActive }) => (isActive ? "active" : undefined)}
          >
            Log in
          </a>
        </li>
      </ul>
      {isAuthenticated() && (
        <div className="user-greeting">Hello {authUser().firstName}</div>
      )}
    </div>
  );
};

export default NavigationBar;
